The past few years have been anything but normal, especially with the pandemic. One thing that I have been struggling with over the past few years is Long Covid.

 #longcovid is a term used for a group of symptoms that can appear days or weeks after successfully recovering from a COVID-19 infection. These symptoms can sometimes last for weeks, months, or longer. As of July 2021, Long Covid was recognized as a disability under the Americans with Disabilities Act.

My first encounter with COVID-19 was in April 2020. There are so many people who still believe that COVID-19 is just a “bad flu.” The reality is, some people are met with very few symptoms, while others are bedridden until the symptoms dissipate. We were lucky to get over the symptoms fairly quickly, but it was still a pretty rough time, and definitely nothing like the flu. 

Following this, my health has been declining, significantly. Starting with pulmonary hemoptysis (a lung bleed) in the summer of 2020, joint pains and myalgia’s that caused me to lose my ability to walk at some points between 2021 and 2022, brain fog, insomnia, orthostatic intolerance, such as low blood pressure and high, pounding heart rates — to name a few. 

I want to start bringing awareness to this condition on this platform, as much of the world has fallen back into normalcy, and I want to use my reach for some good. I’ve been enjoying being able to go out with my friends again, and just getting back into the swing of things, but I still think it’s important to talk about this, and the importance of protecting yourself against multiple infections of Covid as your chances of getting LC significantly increases. 

To those who are already dealing with Long Covid, I see you and I hear you. You are not alone and experiencing this. While there are so many unknowns still, there are plenty of support groups on Facebook, Instagram, and outside of social media, through specialist groups and other hospitals.

I’ll be posting more about this soon, but for now, here are some accounts with some great resources to help you learn more:

